        this.setState({
          csv: event.target.files[0]
        })
      }

    return (
        <Input
   type="file"
   ref={(input) => { this.filesInput = input }}
   name="file"
   icon='file text outline'
   iconPosition='left'
   label='Upload CSV'
   labelPosition='right'
   placeholder='UploadCSV...'
   onChange={()=> {
    alert('hi');
   }}
 /> 
);
}

export default ImportCSV;
